('subscribemessage', 'If you\\\'ve somehow got this far through the PHPlist mail subscription process, something has gone wrong! You\\\'re not meant to be here!\r\n\r\nIf you\\\'re a CTC member and wish to receive club mailouts then just log in to the ctc website ( www.[DOMAIN] ) in the usual way, follow the User Details link in the Members menu and set the \\\"onEmailList\\\" variable in your personal profile to \\\"Yes\\\".\r\n\r\nOtherwise, Go Away!\r\n\r\n-- CTC Webmaster\r\n  \r\n    ', 1, NULL),
('unsubscribesubject', 'Oops: something has gone wrong.', 1, NULL),
