nt.png\\\" width=132\r\n      border=0></TD></TR>\r\n  <TR vAlign=top>\r\n    <TD>&nbsp;</TD>\r\n<td><div align=left>\r\n<br />\r\n<h1>Member access to the mail-list capabilities via this site has been disabled</h1>\r\n<p>Please update your personal data via the club website (www.ctc.org.nz) instead. Just log in in the usual way, click User Details in the Members menu and then follow the link to view/edit your personal details, including your mail list subscription status (field \\\'onEmailList\\\') and whether or not you wish to received HTML-format email (field \\\'htmlEmail\\\').</p>', 1, NULL),
