('en', 'default is line break', 'default is line break'),
('en', 'If you check \\\"Test Output\\\", you will get the list of parsed emails on screen, and the database will not be filled with the information. This is useful to find out whether the format of your file is correct. It will only show the first 50 records.', 'If you check Test Output, you will get the list of parsed emails on screen, and the database will not be filled with the information. This is useful to find out whether the format of your file is correct. It will only show the first 50 records.'),
('en', 'If you check \\\"Show Warnings\\\", you will get warnings for invalid records. Warnings will only be shown if you check \\\"Test Output\\\". They will be ignored when actually importing.', 'If you check Show Warnings, you will get warnings for invalid records. Warnings will only be shown if you check Test Output. They will be ignored when actually importing.'),
('en', 'Show Warnings', 'Show Warnings'),
('en', 'If you check \\\"Omit Invalid\\\", invalid records will not be added. Invalid records are records without an email. Any other attributes will be added automatically, ie if the country of a record is not found, it will be added to the list of countries.', 'If you check \\\"Omit Invalid\\\", invalid records will not be added. Invalid records are records without an email. Any other attributes will be added automatically, ie if the country of a record is not found, it will be added to the list of countries.'),
('en', 'Omit Invalid', 'Omit Invalid'),
('en', 'Assign Invalid will be used to create an email for subscribers with an invalid email address. You can use values between [ and ] to make up a value for the email. For example if your import file contains a column \\\"First Name\\\" and one called \\\"Last Name\\\", you can use \\\"[first name] [last name]\\\" to construct a new value for the email for this subscriber containing their first name and last name. The value [number] can be used to insert the sequence number for importing.', 'Assign Invalid will be used to create an email for subscribers with an invalid email address. You can use values between [ and ] to make up a value for the email. For example if your import file contains a column First Name and one called Last Name, you can use [first name] [last name] to construct a new value for the email for this subscriber containing their first name and last name. The value [number] can be used to insert the sequence number for importing.'),
('en', 'Assign Invalid', 'Assign Invalid'),
('en', 'If you check \\\"Overwrite Existing\\\", information about a subscriber in the database will be replaced by the imported information. Subscribers are matched by email or foreign key.', 'If you check \\\"Overwrite Existing\\\", information about a subscriber in the database will be replaced by the imported information. Subscribers are matched by email or foreign key.'),
('en', 'Overwrite Existing', 'Overwrite Existing'),
('en', 'If you check \\\"Retain Old Email\\\", a conflict of two emails being the same will keep the old one and add \\\"duplicate\\\" to the new one. If you don&quot;t check it, the old one will get \\\"duplicate\\\" and the new one will take precedence.', 'If you check \\\"Retain Old Email\\\", a conflict of two emails being the same will keep the old one and add \\\"duplicate\\\" to the new one. If you don\'t check it, the old one will get \\\"duplicate\\\" and the new one will take precedence.'),
('en', 'Retain Old User Email', 'Retain Old Email'),
