('es', 'The file you upload will need to have the attributes of the records on    the first line.     Make sure that the email column is called \\\"email\\\" and not something like \\\"e-mail\\\" or     \\\"Email Address\\\".     Case is not important.          If you have a column called \\\"Foreign Key\\\", this will be used for synchronisation between an     external database and the phpList database. The foreignkey will take precedence when matching     an existing subscriber. This will slow down the import process. If you use this, it is allowed to have     records without email, but an \\\"Invalid Email\\\" will be created instead. You can then do     a search on \\\"invalid email\\\" to find those records. Maximum size of a foreign key is 100.          Warning: the file needs to be plain text. Do not upload binary files like a Word Document.', 'El fichero que subas necesita tener los atributos de los registros en la primera linea. Asegúrese que la columna del email se llama \\\"email\\\" y no algo como \\\"e-mail\\\" o \\\"Dirección de Correo\\\". Las mayúsculas no se toman en cuenta. Si tiene una columna llamada \\\"Foreign Key\\\", ésta se usará para la sincronización entre una base de datos externa y la base de datos de phpList. La \\\"foreignkey\\\" tendrá preferencia para actualizar un suscriptor existente. Esto ralentizará el proceso de importación. Si usa esto, se permite tener registros sin email, pero entonces se creará un \\\"Email Invalido\\\". Entonces puede realizar un búsqueda por \\\"Email Invalido\\\" para encontrar esos registros erróneos. El tamaño máximo de la clave externa (foreign key) es 100. Importante: el fichero necesita ser texto plano. No suba ficheros binarios como, por ejemplo, un Documento Word.'),
