('es', 'If you check \\\"Test Output\\\", you will get the list of parsed emails on screen, and the database will not be filled with the information. This is useful to find out whether the format of your file is correct. It will only show the first 50 records.', 'Si marca la casilla \\\"Probar\\\" verá en su pantalla la lista de los correos analizados y la información no será añadida a su base de datos. Esto sirve para saber si el formato de su fichero es correcto. Sólo se mostrarán los primeros 50 registros.'),
('es', 'If you check \\\"Show Warnings\\\", you will get warnings for invalid records. Warnings will only be shown if you check \\\"Test Output\\\". They will be ignored when actually importing.', 'Si marca \\\"Mostrar Advertencias\\\", usted recibirá avisos de registros no válidos. Las advertencias sólo se mostrarán si se selecciona \\\"Salida de prueba\\\" (Test Output). Los avisos serán ignorados cuando en realidad se este importando.'),
